import React, { Component } from "react"; 
//import "./Slider.css";

class Slider extends Component {
  render() {
    return(

    <div className="sliderContainer">
        <input type="range" min="0" max="1" onChange={this.props.onChange} min="1" max="100" value={this.props.value} className="sliderMain"></input>
    </div>
    );
  }

}

export default Slider;
